Great question, Dave! When you're creating a new Scanner object in Java, you pass System.in as an argument to the Scanner constructor. üìù Here's how you'd write it:

```java
import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        // Now you can use the scanner object to read input from the user!
    }
}
```

In this example, `System.in` represents the standard input stream, which is typically connected to the keyboard. By passing it to the Scanner constructor, you're telling the Scanner object to read input from the keyboard. üéπ
